INSERT INTO qs_hrtools_category ( `c_id`, `c_name`, `c_order`, `c_adminset`, `c_img`, `c_desc` ) VALUES  ('3','员工管理','0','0','','包含工作内容、员工纪律等一系列直接涉及员工福利和工作性质的资料。帮助hr快速专业的落实人才工作。');;
INSERT INTO qs_hrtools_category ( `c_id`, `c_name`, `c_order`, `c_adminset`, `c_img`, `c_desc` ) VALUES  ('4','合同/试用','0','0','','hr下载合适的合同范本作为跟人才之间的契约协议签订，成功实现企业和人才之间的双向选择。');;
