INSERT INTO qs_hrtools_category ( `c_id`, `c_name`, `c_order`, `c_adminset`, `c_img`, `c_desc` ) VALUES  ('7','出差','0','0','','针对公司出差问题，提供相关的出差规定、出差情况记录表等，准确掌握员工工作动态，明晰公司财务清单。');;
